    println(compact(input))

    for( i in 'a'..'z') {
        val removed = input.replace(""+i, "", true)
        println("Compaction for $i is ${compact(removed)}")
    }

    println(('a'..'z').map { compact(input.replace(""+it, "", true)) }.min())
}

fun compact(s: String) : Int {
    var current = s
    var len = current.length+1
    while( current.length < len) {
        len = current.length
        for (i in 'a'..'z') {
            val toRemove = "" + i + (i.toUpperCase())
            current = current.replace(toRemove, "")
            current = current.replace(toRemove.reversed(), "")
        }
    }
    return current.length
}

